import './Activity.scss';
import '../components/Navigation';

export default function Activities() {
  return (
    <div id="activity">
      <Navigation />
      <div className="canoe">
        <img className="activity-img" src="/images/feu.jpg" />
      </div>
      <div className="tube">
        <img className="activity-img" src="/images/feu.jpg" />
      </div>
    </div>
  )
}
